local s=data.subLen2_types

local res=''
local bitV=1
local val=0
local bc=0
for b in s:gmatch'%d' do
	bc=bc+1
	if b=='1' then
		val=val+bitV
	end
	if bitV==128 then
		--print(val)
		res=res..string.char(val)
		val=0
		bitV=1
	else
		bitV=bitV*2
	end
end
if bitV~=1 then
	res=res..string.char(val)
end

print('bit count=',bc,bc/8)
print('res len=',#res)

do
	local f=io.open('bits.bin','wb')
	f:write(res)
	f:close()
end

